import React, {Component} from "react";

class LoadingSpinnerLargeSuccess extends Component {
    render() {
        return (
            <div className="spinner-border text-success m-5"
                 style={{
                     display: 'flex',
                     alignItems: 'center',
                     justifyContent: 'center',
                 }}
                 role="status"/>
        )
    }
}

export default LoadingSpinnerLargeSuccess;
